    def click_me(self):
        link=self.lineEdit.text()
        partoffset='22offset%22%3A'
        for i in range(0,80):
            offsetindicator=str(i)
            offset=(partoffset+offsetindicator+'%')
            if offset in link:
            #print(offset,"\n\n",i,'\n\n')
                novo=partoffset+"#1%"
                novolink=link.replace(offset,novo)
            #print(novolink,'\n\n')
                self.textEdit.setText(novolink)
                
